import { Box } from "@mui/material";
import React, { Fragment } from "react";
import Artist from "./Artist";

const SingleArtistRow = ({ artistsInfo, title }) => {
  return (
    <Fragment>
      <Box sx={{ display: "flex" }}>
        <Box sx={{ height: "200px", width: "200px" }}>{title}</Box>

        <Box sx={{ display: "flex" }}>
          {artistsInfo !== null &&
            artistsInfo.map((artist) => <Artist artist={artist} />)}
        </Box>
      </Box>
    </Fragment>
  );
};

export default SingleArtistRow;
